CREATE SCHEMA IF NOT EXISTS postgremon;

DROP TABLE IF EXISTS postgremon.pokemon;

CREATE TABLE postgremon.pokemon (
	id INTEGER PRIMARY KEY,
	padded_id TEXT,
	name TEXT,
	types TEXT[],
	classification TEXT,
	abilities TEXT[],
	tsv TSVECTOR
);


UPDATE postgremon.pokemon SET padded_id = LPAD(id::text, 3, '0');

UPDATE postgremon.pokemon SET tsv =
	setweight(to_tsvector(array_to_string(ARRAY[name, padded_id], ', ')), 'A') ||
	setweight(to_tsvector(array_to_string(types, ', ')), 'B') ||
	setweight(to_tsvector(classification), 'C') ||
	setweight(to_tsvector(array_to_string(abilities, ', ')), 'D');

CREATE INDEX IX_POKEMON_TSV ON postgremon.pokemon USING GIN(tsv);
